import React from "react";
import { Auth, Home } from "pages";
import { connect } from "react-redux";
import { Route, Routes, Navigate } from "react-router-dom"


const App = (props) => {
  return (
    <div className="wrapper">
      <Routes>
        {["*", "/login"].map((path, key) =>
          <Route
            key={key}
            path={path}
            element={<Auth />}
          ></Route>
        )}
        <Route exact path="/im" element={<Home />} ></Route>
        {props.isAuth ? <Navigate to="/im"></Navigate> : <Navigate to="/login"></Navigate>}
      </Routes>
    </div>
  )
}

